// FrequencyChart.jsx
import React from 'react';
import HeroSection from '../../../components/HeroSection';
import PageLayout from '../../../components/PageLayout';
import InfoCard from '../../../components/InfoCard';

const FrequencyChart = () => {
  return (
    <div className="page multicolor-border p-4 rounded-2xl shadow-lg">
      <h1 className="text-3xl font-bold mb-4">Frequency Chart</h1>
      <p>Each object in the universe vibrates at a frequency. Healing frequencies, like 432 Hz and 528 Hz, are believed to promote harmony and repair DNA.</p>
      <p>Sound healing uses tuning forks, singing bowls, and music to shift energetic blockages. Frequencies are also connected to specific chakras and emotions.</p>
      <p>By understanding and applying frequency science, we can realign the body and mind toward optimal wellness.</p>
    </div>
  );
};

export default FrequencyChart;
